IF EXISTS(SELECT 1 FROM sys.tables WHERE object_id = OBJECT_ID('tbl_Sales'))
BEGIN;
    DROP TABLE tbl_Sales;
END;
GO

CREATE TABLE tbl_Sales (
    ID INTEGER NOT NULL IDENTITY(1, 1),
    repID INTEGER NULL,
    SalesRep VARCHAR(255) NULL,
    Jan VARCHAR(100) NULL,
    Feb VARCHAR(100) NULL,
    Mar VARCHAR(100) NULL,
    Apr VARCHAR(100) NULL,
    May VARCHAR(100) NULL,
    Jun VARCHAR(100) NULL,
    Jul VARCHAR(100) NULL,
    Aug VARCHAR(100) NULL,
    Sep VARCHAR(100) NULL,
    Oct VARCHAR(100) NULL,
    Nov VARCHAR(100) NULL,
    Dec VARCHAR(100) NULL,
    PRIMARY KEY (ID)
);
GO

